package Class4;

public class MyProgram9 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//difference between while and do while
		
		int count = 100;
		
		while (count < 10) {
			System.out.print(count + " ");
			count++;
		}
		
		do {
			System.out.print(count + " ");
			count++;
		} while (count < 10);
		

	}

}
